import { HiHand } from "react-icons/hi";

// Styled Components
import { InteractButtons} from ".\styled\posts\interactButtons.js"

export default function InteractButtonsComponent() {
    return (
        <InteractButtons>
        <HiHand/>
        <HiHand/>
        <HiHand/>
        </InteractButtons>
    );
    }
